{
  "task_id": "eq_research_amd_price_profile_001",
  "user_prompt": "What does AMD do, and what is its current price and 1-day change? Answer in ≤120 words with one short citation to a source.",
  "complexity": "simple",
  "max_turns": 4,
  "tools_available": [
    "polygon: polygon_get_aggs",
    "polygon: polygon_get_news",
    "fmp: fmp_get_quote",
    "fmp: fmp_get_income_statement",
    "fmp: fmp_get_company_profile",
    "tavily: tavily_search",
    "tavily: tavily_extract",
    "slack: send_slack_message",
    "slack: list_slack_channels",
    "python_execution: execute_python",
    "python_execution: process_mcp_data"
  ],
  "limits": {
    "max_tools": 5,
    "max_servers": 5
  },
  "tool_sequence": [
    {
      "step": 1,
      "server": "fmp",
      "tool": "fmp_get_company_profile",
      "params": {
        "symbol": "AMD"
      },
      "analysis_requirements": {
        "extract": [
          "description",
          "industry",
          "sector"
        ],
        "compute": [
          "business_summary = concat(industry, \": \", description)"
        ],
        "select": [],
        "accept_if": [
          "description is not None",
          "industry is not None"
        ],
        "next_args_from": "description"
      }
    },
    {
      "step": 2,
      "server": "fmp",
      "tool": "fmp_get_quote",
      "params": {
        "symbol": "AMD",
        "profile_description": "${description}"
      },
      "analysis_requirements": {
        "extract": [
          "price",
          "changesPercentage",
          "volume",
          "profile_description"
        ],
        "compute": [
          "business_description = profile_description",
          "one_day_change = changesPercentage"
        ],
        "select": [],
        "accept_if": [
          "price is not None",
          "one_day_change is not None",
          "business_description is not None"
        ]
      }
    }
  ],
  "final_answer_requirements": {
    "format": "text",
    "must_include": [
      "business_description",
      "current_price",
      "one_day_change",
      "citation"
    ],
    "grounded_from": [
      "business_description",
      "price",
      "one_day_change"
    ],
    "quality_criteria": [
      "no hallucinations",
      "concise",
      "≤120 words",
      "include one short citation to a source"
    ]
  },
  "judge_rubric": {
    "weights": {
      "coverage": 0.4,
      "grounding": 0.3,
      "clarity": 0.2,
      "safety": 0.1
    },
    "target_length_range": [
      10,
      120
    ]
  }
}
